import React from "react";
 
import './Card.css'

export default function Card({data}){


    return(
        <>

          <div className="con"> 

         {data.map((card,index)=>(
       <div className=""> 
           <div  key ={index}className="card">

           <h1>{card.clinic}</h1>

         </div>
         </div>
         ))}
         </div>

        
        </>
    )
}
